import React, { useState } from "react";
import './UsersList.css';
import UserItem from "./UserItem";

const UsersList = props => {
    return (
        <ul>
            {props.items.map(user => (
                <UserItem items={props.items}>
                    {user.name}
                </UserItem>
            ))}
        </ul>
    );
}

export default UsersList;
